import React from 'react';

class ServicesList extends React.Component{
  render() {
	const {data} = this.props;

	let servicesLists = data.map((servicesList) =>
	  <li key={servicesList.id}>{servicesList.id}</li>
	)

    return(
      <ul>{servicesLists}</ul>
	)
  }
}
export default ServicesList;
